import React, {useRef} from 'react'
import { Canvas } from '@react-three/fiber'


const Cube = () => {
    const mesh = useRef();

    return (
      <mesh ref={mesh}>
        <boxGeometry args={[1, 1, 1]} />
        <meshBasicMaterial color={0xffffff} />
      </mesh>
    );
  };


const Background = () => {

    return (
        <Canvas>
          <Cube />
        </Canvas>
      );
}


export default Background
